{
    const response = await fetch("https://storage.googleapis.com/programiz-static/hiring/software/job-listing-page-challenge/data.json");
    const responseJSON = await response.json();
    responseJSON.then(() => {
        return(
            <h1> {typeof(responseJSON)} </h1>
        )}
    )
}
